DROP TABLE IF EXISTS osm_marine;
CREATE TABLE osm_marine (
    name varchar(100),
    name_en varchar(100),
    name_de varchar(100),
    name_fr varchar(100),
    name_es varchar(100),
    name_ru varchar(100),
    name_zh varchar(100),
    scalerank integer,
    geometry geometry,
    id integer primary key
);


ALTER TABLE osm_marine ALTER COLUMN geometry TYPE geometry USING ST_Transform(geometry, 900913);
SELECT UpdateGeometrySRID('osm_marine', 'geometry', 900913);
